import React, { Component } from 'react'; 
import SignUpForm from './SignUpForm';

export default class Main extends Component {

    render() {
        return (
            <div className="row">
                <SignUpForm />
                <section className="col-sm-12 col-md-6 col-lg-7"></section>
                <section></section>
            </div>
        )
    }
}
